style.css:
@-moz-document url-prefix("https://progtest.fit.cvut.cz") {
body{
 background-color: #4b4b4b !important;
}

/* Default state (when details is closed) */
details.menuList {
  background-color: #797979;
  cursor: pointer;
  padding: 10px;
}

/* When the details element is open */
details.menuList[open] {
  /*background-color: lightgreen;*/
  padding: 10px;
}

/* Alternatively, using the :open pseudo-class */
details.menuList:open {
 /* background-color: lightgreen;*/
  padding: 10px;
}

.bigButLink, .bigButDis{
   background-color: #dbdbdb00  !important;
}

.bigButLink  > div, .bigButDis > div{
  background-color: #8d8d8d  !important;
  border-color: #5b5b5b !important;
  border: 1px solid #d5d9d9;
  border-radius: 8px;
  box-sizing: border-box;
  color: #0f1111;
  cursor: pointer;
  display: inline-block;
  font-family: "Amazon Ember",sans-serif;
  font-size: 13px;
  line-height: 29px;
  padding: 0 10px 0 11px;
  position: relative;
  text-align: center;
  text-decoration: none;
  user-select: none;
  -webkit-user-select: none;
  touch-action: manipulation;
  vertical-align: middle;
  border-color: #fff;
}

.bigButLink:hover  > div, .bigButDis:hover > div{
  background-color: #9f9f9f !important;
}

.bigButLink:focus  > div, .bigButDis:focus > div{
  border-color: #008296;
  box-shadow: rgba(213, 217, 217, .5) 0 2px 5px 0;
  outline: 0;
}

a:hover {
    color: #4b4b4b;
}

.submitDis{
  color: #272727;
}

div.bigButDis > div > b > div > span {
  color: #5f5f5f;
}

div.navLink {
    /* background-image: linear-gradient(to bottom, #808080 0%, #606060 100%); */
    background-image: linear-gradient(to bottom, #00ff16 0%, #00ff16 100%);
}

.newBox {
    background-color: #797979;
}

.textOk {
  text-shadow: 
    -0.5px -0.5px 0 #2b2b2b,  
    0.5px -0.5px 0 #2b2b2b,  
    -0.5px 0.5px 0 #2b2b2b,  
    0.5px 0.5px 0 #2b2b2b;
    color: #4eb900;
}

.textCrit {
  text-shadow: 
    -0.5px -0.5px 0 #2b2b2b,  
    0.5px -0.5px 0 #2b2b2b,  
    -0.5px 0.5px 0 #2b2b2b,  
    0.5px 0.5px 0 #2b2b2b;
    color: #bf5353;
}
}
